.top-holder {
	margin-top: 12px;
}
.vehicle {
	width: 100%;
	.link-to-detail{
		cursor: pointer;
		color: #20a8d8;
		&:hover{
			text-decoration: underline;
		}
	}

	.search-group {
		width: 40%;
		margin-top: 2%;
		display: inline-block;
		input {
			height: 40px;
		}
		button {
			margin-left: 0px;
			height: 36px;
		}
		a {
			margin-left: 10%;
		}
	}
	i {
		margin-right: 4px;
	}
	.collapse-m {
		border-color: #1FA8D8;
		border-style: dashed;
	}
	.table-outline {
		margin-top: 2%;
	}
	.filter-content {
		display: inline-block;
	}
	.header-right {
		float: right;
		button {
			background-color: #20a8d8!important;
			border-color: #20a8d8!important;
		}
	}
}
.btn {
	margin: 2px;
}
